                  startTimeUnixNano: "1000000"
                  timeUnixNano: "2000000"
            unit: '{virtual_machine_templates}'
          - description: The congestions of IOs generated by all vSAN clients in the cluster.
            gauge:
              dataPoints:
                - asDouble: 5
                  startTimeUnixNano: "3000000"
                  timeUnixNano: "1000000"
                - asDouble: 6
                  startTimeUnixNano: "3000000"
                  timeUnixNano: "2000000"
